  \"2016-07-27T23:02:45.331164\",\n\t\"name\": \"whittier-small-boat-harbor-shotgun-cove-whittier-alaska-feasibility-stage-planning-aid-rep\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Site A {Mouth of the Cove) is the most
  environmentally acceptable alternative and should be studied further. The impacts
  expected to occur at the less environmentally accepted alternative {Site B; Head
  of the Cove) are considerably greater and will require additional environmental
  studies to conclusively delineate their extent and magnitude. Important fish and
  wildlife resources associated with Site B include three anadromous fish streams
  {Clean, Barge and Shotgun Creeks), eelgrass beds, mussel beds, black bear, estuarine
  like conditions, and good water quality. Potential impacts to the aforementioned
  resources revolve around the following direct and indirect project related activities:
  1) dredging, 2) dredge disposal, 3) floating breakwater and stub breakwater construction,
  and 4) secondary developments.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
